import React from 'react';
import logo from './logo.svg';
import './HealthcareProvider.css';
import Web3 from 'web3';
import { Table } from 'react-bootstrap';

var web3;
if (typeof window.web3 !== 'undefined') {
  web3 = new Web3(window.web3.currentProvider);
} else {
  // set the provider you want from Web3.providers
  web3 = new Web3(new Web3.providers.HttpProvider("http://localhost:8545"));
}

const inputStyle = {
  borderRadius:5,
  fontSize:15,
  borderTop:0,
  borderLeft:0,
  borderRight:0,
  height:30,
  marginRight:10
};
const buttonStyle = {
  borderRadius:5,
  fontSize:15,
  borderTop:0,
  borderLeft:0,
  borderRight:0,
  height:40,
  width: 90,
  marginLeft: 180,
  color:"white",
  backgroundColor:"coral"
};
const buttonStyle2 = {
  borderRadius:5,
  fontSize:15,
  borderTop:0,
  borderLeft:0,
  borderRight:0,
  height:40,
  width: 90,
  marginLeft: 10,
  color:"white",
  backgroundColor:"coral"
};
const buttonStyle3 = {
  borderRadius:5,
  fontSize:15,
  borderTop:0,
  borderLeft:0,
  borderRight:0,
  height:30,
  width: 30,
  marginLeft: 3,
  color:"white",
  backgroundColor:"blue"
};

function HealthcareProvider() {
  return (
    <div className="">
      <header className="HealthcareProvider-header">
        <img src={logo} className="HealthcareProvider-logo" alt="logo" />
        <p>
          Edit <code>src/HealthcareProvider.js</code> and save to reload.
        </p>
        <a
          className="HealthcareProvider-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default HealthcareProvider;
